DELIMITER $$
CREATE TRIGGER `earliest_order_date` AFTER INSERT ON `client_order` FOR EACH ROW BEGIN
    DECLARE earliest_date DATETIME;

    -- Find the earliest order date for the client
    SELECT MIN(date) INTO earliest_date
    FROM client_order
    WHERE client_id = NEW.client_id;

    -- Update the client's earliest order date
    UPDATE client
    SET date = earliest_date
    WHERE client_id = NEW.client_id;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `nuber_Of_Orders` AFTER INSERT ON `client_order` FOR EACH ROW BEGIN
    DECLARE numOrders INT;

    -- Count the total orders remaining for the client
    SELECT COUNT(*) INTO numOrders
    FROM client_order 
    WHERE client_id = NEW.client_id;

    -- Update the client table with the new order count
    UPDATE client
    SET quantity = numOrders
    WHERE client_id = NEW.client_id;
END
$$
DELIMITER ;
