DELIMITER $$
CREATE TRIGGER `update_client_status` AFTER UPDATE ON `client_order` FOR EACH ROW BEGIN
    DECLARE pendingOrders INT DEFAULT 0;
    DECLARE finishedOrders INT DEFAULT 0;
    DECLARE claimedOrders INT DEFAULT 0;
    DECLARE allOrders INT DEFAULT 0;

    -- Count the total number of all orders for the client
    SELECT COUNT(*) INTO allOrders
    FROM client_order
    WHERE client_id = NEW.client_id;

    -- Check if there are no orders and set order status to 'No Orders!'
    IF allOrders = 0 THEN
        UPDATE client SET order_status = 'No Orders!' 
        WHERE client_id = NEW.client_id;
    ELSE
        -- Count the number of pending orders for the client
        SELECT COUNT(*) INTO pendingOrders 
        FROM client_order 
        WHERE client_id = NEW.client_id AND status = 'Pending';

        -- Count the number of finished orders for the client
        SELECT COUNT(*) INTO finishedOrders
        FROM client_order 
        WHERE client_id = NEW.client_id AND status = 'Finished';

        -- Count the number of claimed orders for the client
        SELECT COUNT(*) INTO claimedOrders
        FROM client_order 
        WHERE client_id = NEW.client_id AND status = 'Claimed';

        -- Continue with the rest of the conditions
        IF pendingOrders > 0 THEN
            UPDATE client SET order_status = 'Pending' 
            WHERE client_id = NEW.client_id;
        ELSEIF finishedOrders > 0 THEN
            UPDATE client SET order_status = 'Finished' 
            WHERE client_id = NEW.client_id;
        ELSEIF claimedOrders > 0 AND claimedOrders = allOrders THEN
            UPDATE client SET order_status = 'Claimed' 
            WHERE client_id = NEW.client_id;
        END IF;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `update_client_status_after_insert` AFTER INSERT ON `client_order` FOR EACH ROW BEGIN
    DECLARE pendingOrders INT;
    DECLARE finishedOrders INT; 
    DECLARE claimedOrders INT; 
    DECLARE allOrders INT;

    SELECT COUNT(*) INTO pendingOrders 
    FROM client_order 
    WHERE client_id = NEW.client_id AND status = 'Pending';

    SELECT COUNT(*) INTO finishedOrders
    FROM client_order 
    WHERE client_id = NEW.client_id AND status = 'Finished';

    SELECT COUNT(*) INTO claimedOrders
    FROM client_order 
    WHERE client_id = NEW.client_id AND status = 'Claimed';

    SELECT COUNT(*) INTO allOrders
    FROM client_order
    WHERE client_id = NEW.client_id;

    IF pendingOrders > 0 THEN
        UPDATE client SET order_status = 'Pending' WHERE client_id = NEW.client_id;
    ELSEIF finishedOrders > 0 THEN
        UPDATE client SET order_status = 'Finished' WHERE client_id = NEW.client_id;
    ELSEIF claimedOrders > 0 AND claimedOrders = allOrders THEN
        UPDATE client SET order_status = 'Claimed' WHERE client_id = NEW.client_id;
    ELSE
        UPDATE client SET order_status = 'No Orders!' WHERE client_id = NEW.client_id;
    END IF;
END
$$
